//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./required/ERC721.sol";
import "./required/Ownable.sol";

import "./CertificateNFT.sol";

contract Donation {
    CertificateNFT cft;
    address owner;

    // Donor Structure
    struct Donor {
        uint256 donorID; //Donor unique ID
        address donorAddress; //Donor address
        uint256 amount; //donation amount
        uint certificatesSent; //number of certificates donor received
    }
    uint256 private counter = 0; // Used to generate unique ID
    uint public certificateID; // Unique ID generated using counter

    // Fundraiser structure
    struct Fundraiser {
        address fundraiserAddress; //fundraiser address
        string usageDetails; //Funds usage details
		uint256 goalAmount; //goal amount
		uint256 amountRaised; //amount raised
		bool isActive; // check if fundraiser is active or no
		Donor[] donatedBy; // List of donors
    }

    // Store all the fundraisers
    mapping (address=>Fundraiser) public fundraisers ;
    mapping (address=>uint) public membership; //Owner, Fundraiser = 1; Others = 0
    // List of all donors
    Donor[] public donorList;

    // modifier to check for owner
    modifier onlyOwner{ 
        require(msg.sender==owner);
        _;
    }

    // modifier to check for fundraiser or others
    modifier onlyFundraiser { 
        require(membership[msg.sender]==1);
        _;
    }
     function getOwner() public view returns (address) {
        return owner;
    }

    // constructor to initiate owner when deployed - accepts nft address
    constructor(address CFTAdress) {
        cft = CertificateNFT(CFTAdress);
        owner = msg.sender;
        membership[msg.sender] = 1;
        certificateID = 0;
    }

    // only owner can register for fundraisers
    function register(address newFundraiser, uint requiredFunds) public onlyOwner{
        address fundraiser = newFundraiser;      
        membership[fundraiser]=1;
        fundraisers[fundraiser].goalAmount = requiredFunds;
        fundraisers[fundraiser].isActive = true;
        fundraisers[fundraiser].fundraiserAddress = newFundraiser;
        fundraisers[fundraiser].usageDetails = '';
    }

    // generate random unique ID
    function generateRandomId() public returns (uint256) {
        uint256 randomNumber = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, counter)));
        counter++;
        return randomNumber;
    }

      function donateFunds(address payable toFundraiser) public payable {
        uint donatedAmount = msg.value/1000000000000000000;
        require(fundraisers[toFundraiser].isActive == true, "Fundraiser should be active to donate");
        require(donatedAmount > 0, "Donation amount must be greater than zero");
        require(membership[toFundraiser]==1, "Only Fundraiser address can be given");
        // require(membership[msg.sender]!=1, "Money can be donated to Fundraiser address only");
        fundraisers[toFundraiser].amountRaised += donatedAmount;
        (bool sent, bytes memory data) = toFundraiser.call{value: msg.value}("");
        require(sent, "Failed to send Ether");
        Donor memory currentDonor = Donor(certificateID,msg.sender, donatedAmount, 0);
        certificateID += 1;
        // fundraiser address, SC address, donorID, tokenId
        cft.createNFT(toFundraiser, address(this), currentDonor.donorID);
        cft.transferNFT(toFundraiser,currentDonor.donorAddress, address(this), currentDonor.donorID);

        currentDonor.certificatesSent +=1 ;
        donorList.push(currentDonor);
        fundraisers[toFundraiser].donatedBy.push(currentDonor);        
    }

    // send certificates to all the donors once the goal amount is reached
    function sendCertificates(string memory usage) onlyFundraiser public{
        address toFundraiser = msg.sender;        
        require(fundraisers[toFundraiser].amountRaised >= fundraisers[toFundraiser].goalAmount, "Goal amount not reached");
        fundraisers[toFundraiser].usageDetails = usage;
        fundraisers[toFundraiser].isActive = false;
        for(uint i=0;i< fundraisers[toFundraiser].donatedBy.length;i++){
            // ceate and send NFT to donor
            cft.createNFT(toFundraiser, address(this), certificateID);
            cft.transferNFT(toFundraiser,fundraisers[toFundraiser].donatedBy[i].donorAddress, address(this), certificateID);
            certificateID += 1;
            fundraisers[toFundraiser].donatedBy[i].certificatesSent += 1;
            donorList.push(fundraisers[toFundraiser].donatedBy[i]);
        }
    }

    // unrregister the fundraiser once the goal amount is reached
    function unRegister(address requestedBy) onlyOwner public {
        require(fundraisers[requestedBy].isActive = true, "Fundraiser is Inactive");
        fundraisers[requestedBy].isActive = false;
    }

    // get the fundraiser details
    function getFundraiserDetails() view public onlyFundraiser returns(Donor[] memory fundraiserAmount) {
        fundraiserAmount = fundraisers[msg.sender].donatedBy;
    }

    // Check total certificates issued till now
    function totalCertificatesIssued() public view returns(uint totalCertificateCount) {
        totalCertificateCount = donorList.length;
    }

}
